import dayStyles from "./dayStyles.js";
import {
  React,
  theme,
  calendarStyles,
  ThemeProvider,
  Button,
} from "./index.js";

const DayButton = (day) => {
  const classes = calendarStyles();

  const date = parseInt(day.day);
  return (
    <div>
      <ThemeProvider theme={theme}>
        <Button
          className={
            // dayStyles(date) == "before"
            //   ? classes.beforeDayButton
            //   : dayStyles(date) == "today"
            //   ? classes.todayDayButton
            //   : classes.afterDayButton
            classes.afterDayButton
          }
        >
          {day.day}
        </Button>
      </ThemeProvider>
    </div>
  );
};

export default DayButton;
